  `status` enum('normal','hidden') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'normal' COMMENT '状态',
  `state` enum('0','1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '状态值:0=禁用,1=正常,2=推荐',
  `buy_num` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '购买次数',
  `last_buy_time` int(10) UNSIGNED NOT NULL COMMENT '最后购买日期',
  `last_buy_money` float(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '最后购买金额',
  `total_money` float(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '购买总金额',
  `total_integral` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '总积分元',
  `exchange_integral` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '兑换积分元',
  `surplus_integral` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '剩余积分元',
  `admin_id` int(10) NOT NULL COMMENT '管理员ID',
  `invoice_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '发票抬头',
  `tin` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '纳税人识别号',
  `company_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公司地址',
  `company_mobile` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公司电话',
  `bank_deposit` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '开户银行',
  `bank_number` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '银行帐号',
  `customer_type` enum('0','1') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '客户类型:0=普通客户,1=VIP客户',
  `remark` text CHARACTER SET utf32 COLLATE utf32_general_ci NOT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_name`(`customer_name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '客户列表' ROW_FORMAT = Compact;

